void SysTick_Handler(void){
		if(i < 5654016){
			Fresult = f_open(&Handle, inFilename, FA_READ);
			Fresult = f_read(&Handle, &c, 2, &successfulreads);
      Fresult = f_close(&Handle);
			DACOut(c);
			#ifdef FOURTY
			i++;
			#endif
			#ifdef TWENTY
			i+=2;
			#endif
			#ifdef ELEVEN
			i+=4;
			#endif
	  }
		else
			i=0;
	}
